import React from 'react';
import Button from 'react-bootstrap/Button';



export class CompanyTile extends React.Component {
    render() {
        return (
            <div>
                <h1>{this.props.companyObj.name}</h1>
                <h2>{this.props.companyObj.price}</h2>
                <img alt={this.props.companyObj.name} src={this.props.companyObj.logo} />
            </div>
        );
    }
}
